int DOMTest_ConfidenceIndicator_content_derivations (OSCTXT* pctxt, 
   ConfidenceIndicator_content_derivations* pvalue, 
   xmlNodePtr pXmlNode, OSBOOL setChild)
{
   const OSUTF8CHAR* xsiType = 0;
   xmlAttrPtr pXmlAttr = pXmlNode->properties;

   /* Find xsi:type attribute */
   for ( ; 0 != pXmlAttr; pXmlAttr = pXmlAttr->next) {
      if (pXmlAttr->type == XML_ATTRIBUTE_NODE) {
         if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("type"))) {
            xmlChar* pPrefix;
            xsiType = xmlSplitQName2 (pXmlAttr->children->content, &pPrefix);
         }
      }
   }

   /* Call derived function based on type name */
   if (0 == xsiType) {
      xsiType = OSUTF8("ConfidenceIndicator_content");
   }
   if (rtxUTF8StrEqual (xsiType, OSUTF8("ConfidenceIndicator_content")))
   {
      pvalue->t = 1;
      pvalue->u.confidenceIndicator_content
          = rtxMemAllocType (pctxt, ConfidenceIndicator_content);

      if (pvalue->u.confidenceIndicator_content == NULL)
         return LOG_RTERR (pctxt, RTERR_NOMEM);

      asn1Init_ConfidenceIndicator_content (pvalue->u.confidenceIndicator_content);
      DOMTest_ConfidenceIndicator_content (pctxt, pvalue->u.confidenceIndicator_content, pXmlNode, TRUE);
   }
   else if (rtxUTF8StrEqual (xsiType, OSUTF8("_Error")))
   {
      pvalue->t = 2;
      pvalue->u.error
          = rtxMemAllocType (pctxt, ConfidenceIndicator_content_derivations_error);

      if (pvalue->u.error == NULL)
         return LOG_RTERR (pctxt, RTERR_NOMEM);

      asn1Init_ConfidenceIndicator_content_derivations_error (pvalue->u.error);
      DOMTest_ConfidenceIndicator_content_derivations_error (pctxt, pvalue->u.error, pXmlNode, TRUE);
   }
   else if (rtxUTF8StrEqual (xsiType, OSUTF8("_PValue")))
   {
      pvalue->t = 3;
      pvalue->u.pValue
          = rtxMemAllocType (pctxt, ConfidenceIndicator_content_derivations_pValue);

      if (pvalue->u.pValue == NULL)
         return LOG_RTERR (pctxt, RTERR_NOMEM);

      asn1Init_ConfidenceIndicator_content_derivations_pValue (pvalue->u.pValue);
      DOMTest_ConfidenceIndicator_content_derivations_pValue (pctxt, pvalue->u.pValue, pXmlNode, TRUE);
   }
   else if (rtxUTF8StrEqual (xsiType, OSUTF8("_ExpectedValue")))
   {
      pvalue->t = 4;
      pvalue->u.expectedValue
          = rtxMemAllocType (pctxt, ConfidenceIndicator_content_derivations_expectedValue);

      if (pvalue->u.expectedValue == NULL)
         return LOG_RTERR (pctxt, RTERR_NOMEM);

      asn1Init_ConfidenceIndicator_content_derivations_expectedValue (pvalue->u.expectedValue);
      DOMTest_ConfidenceIndicator_content_derivations_expectedValue (pctxt, pvalue->u.expectedValue, pXmlNode, TRUE);
   }
   else {
      printf ("unknown xsi type\n");
   }

   return 0;
}

